def minSkew(S):
    count = 0
    skew = []
    min = 0
    minpos = []
    for i, c in enumerate(S):
        skew.append(count)
        if c == 'C':
            count-=1
            if count<min:
                minpos=[]
                min = count
                minpos = [i+1]
            elif count==min:
                minpos.append(i+1)
        elif c == 'G':
            count+=1

    out = ' '.join(str(e) for e in minpos)
    print(out)
    return(out)

minSkew('')
